 how the child of Portuguese immigrant farmers became a Republican heavy.\n Subscribe to NowThis: http://go.nowth.is/News_Subscribe\n Sign up for our newsletter KnowThis to get the biggest stories of the day delivered straight to your inbox: https://go.nowth.is/KnowThis\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his familys dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, t ARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his familys dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n"},{"text":"#WhoIs","navigationEndpoint":{"clickTrackingParams":"CKoBENzXBBgHIhMIi57w0em29gIVBRlYCh3tqAfh","commandMetadata":{"webCommandMetad  the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trumps every move, he was working on his familys 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasnt acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n Its worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a slow-motion terrorist attack. Nunes might want to stop campaigning for guys that want to rid the country of the very people his familys farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n"},{"text":"#WhoIs","navigationEndpoint":{"clickTrackingParams":"CCAQ3NcEGAYiEwiLnvDR6bb2AhUFGVgKHe2oB-E=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/whois","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUHCgV3aG9pcw%3D%3D"}},"loggingDirectives":{"trackingParams":"CCAQ3NcEGAYiEwiLnvDR6bb2AhUFGVgKHe2oB-E=","visibility":{"types":"12"}}},{"text":" "},{"text":"#DevinNunes","navigationEndpoint":{"clickTrackingParams":"CB8Q3NcEGAgiEwiLnvDR6bb2AhUFGVgKHe2oB-E=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/devinnunes","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUMCgpkZXZpbm51bmVz"}},"loggingDirectives":{"trackingParams":"CB8Q3NcEGAgiEwiLnvDR6bb2AhUFGVgKHe2oB-E=","visibility"
